__NUXT_JSONP__("/gallery/pier-pressure", (function(a,b){return {data:[{document:{date:a,title:[{type:"heading3",text:"Pier Pressure",spans:[]}],photo:{dimensions:{width:800,height:1146},alt:a,copyright:a,url:"https:\u002F\u002Fimages.prismic.io\u002Ffunk\u002Fbf522615-18b9-47ff-8c41-515e8cf724ff_Pier+Pressure.jpg?auto=compress,format",small:{dimensions:{width:320,height:458},alt:a,copyright:a,url:"https:\u002F\u002Fimages.prismic.io\u002Ffunk\u002Fbf522615-18b9-47ff-8c41-515e8cf724ff_Pier+Pressure.jpg?auto=compress,format&rect=0,0,800,1145&w=320&h=458"}},content:[{type:b,text:"OK, I know there’s a gazillion pier pictures out there…\nSo this makes a gazillion-and-one!",spans:[]},{type:b,text:"Taken at Flagler Beach, 45 mins south of Daytona, Florida.\nDon’t  know how many times it’s been knocked down into the sea by storms, but  the people of Flagler like to fish and they need a pier to fish from and  so they build it back up again even stronger than it was.\nBut for the mo, tide`s out, fish are snappin’…\nNo pressure…",spans:[]},{type:b,text:"Canon 5D MkI, 16-35mm, 3 bracketed shots put together and tone mapped in Photomatix.",spans:[]}],page:"Page 3",tag:"landscape"}}],fetch:[],mutations:void 0}}(null,"paragraph")));